/* Major category values - mutually exclusive */
#define Category_Letter (1u << 0)
#define Category_Mark (1u << 1)
#define Category_Number (1u << 2)
#define Category_Other (1u << 3)
#define Category_Punctuation (1u << 4)
#define Category_Separator (1u << 5)
#define Category_Symbol (1u << 6)
/*
    Minor category values - note: their values overlap so tests must include equals")
    To test for a minor, you must do like:"
        if ( (codepoint & Category_Letter_Upper) == Category_Letter_Upper) ..."
*/
#define Category_Letter_Lowercase ( (1u << 7) | (1u << 0))
